        public long? entryID;
        public OrganicGenus genus => species.genus;
        public OrganicSpecies species; 
        public decimal minG;
        public decimal maxG;
        public decimal minK;
        public decimal maxK;
        public List<string> planetClass;
        public List<string> atmosphereClass;
        public List<string> starClass;
        public List<string> volcanism;

        // For future use, if we want to add some species specific description.
        // public string description => Properties.OrganicVariantDesc.ResourceManager.GetString( NormalizeVariant( edname ) );
        public int minimumDistanceMeters => genus.minimumDistanceMeters;

        public bool isPredictable => ( minG > 0 ) ||
                                     ( maxG > 0 ) ||
                                     ( minK > 0 ) ||
                                     ( maxK > 0 ) ||
                                     planetClass.Any() ||
                                     atmosphereClass.Any() ||
                                     volcanism.Any() ||
                                     starClass.Any();

        // dummy used to ensure that the static constructor has run
        public OrganicVariant () : this( "" )
        { }

        private OrganicVariant ( string variant ) : base( variant, variant )
        {
            this.planetClass = new List<string>();
            this.atmosphereClass = new List<string>();
            this.starClass = new List<string>();
            this.volcanism = new List<string>();
        }

        private OrganicVariant ( string edname,
            long? entryID,
            OrganicSpecies species,
            decimal minG,
            decimal maxG,
            decimal minK,
            decimal maxK,
            string planetClass,
            string atmosphereClass,
            string starClass,
            string volcanism ) : base( edname, edname )
        {
            this.entryID = entryID;
            this.species = species;
            this.minG = minG;
            this.maxG = maxG;
            this.minK = minK;
            this.maxK = maxK;
            this.planetClass = !string.IsNullOrEmpty( planetClass ) ? planetClass.Split( ';' ).ToList() : new List<string>();
            this.atmosphereClass = !string.IsNullOrEmpty( atmosphereClass ) ? atmosphereClass.Split( ';' ).ToList() : new List<string>();
            this.starClass = !string.IsNullOrEmpty( starClass ) ? starClass.Split( ';' ).ToList() : new List<string>();
            this.volcanism = !string.IsNullOrEmpty( volcanism ) ? volcanism.Split( ';' ).ToList() : new List<string>();
        }

        private OrganicVariant ( string edname,
            long? entryID,
            OrganicSpecies species,
            decimal minG,
            decimal maxG,
            decimal minK,
            decimal maxK,
            IList<string> planetClass,
            IList<string> atmosphereClass,
            IList<string> starClass,
            IList<string> volcanism ) : base( edname, edname )
        {
            this.entryID = entryID;
            this.species = species;
            this.minG = minG;
            this.maxG = maxG;
            this.minK = minK;
            this.maxK = maxK;
            this.planetClass = planetClass.ToList();
            this.atmosphereClass = atmosphereClass.ToList();
            this.starClass = starClass.ToList();
            this.volcanism = volcanism.ToList();
        }

        /// <summary>
        /// Try getting data from the entryid first, then use variant name as a fallback
        /// </summary>
        public static OrganicVariant Lookup ( long? entryId, string edname )
        {
            try
            {
                if ( entryId != null )
                {
                    return AllOfThem.Single( a => a.entryID == entryId );
                }
            }
            catch ( InvalidOperationException e )
            {
                if ( AllOfThem.Count( a => a.entryID == entryId ) > 1 )
                {
                    Logging.Error( $"Duplicate EntryID value {entryId} in {nameof( OrganicVariant )}.", e );
                }
                else if ( AllOfThem.All( a => a.entryID != entryId ) )
                {
                    Logging.Error( $"Unknown EntryID value {entryId} with normalized edname {NormalizeVariant( edname )} in {nameof( OrganicVariant )}.", e );
                }
            }

            return FromEDName( NormalizeVariant( edname ) ) ??
                   new OrganicVariant( NormalizeVariant( edname ) ); // No match.
        }

        public static new OrganicVariant FromEDName ( string edname )
        {
            return ResourceBasedLocalizedEDName<OrganicVariant>.FromEDName( NormalizeVariant( edname ) );
        }

        public static string NormalizeVariant ( string edname )
        {
            return edname?
                .Replace( "Codex_Ent_", "" )
                .Replace( "$", "" )
                .Replace( "_Name;", "" )
                .Replace( "_name;", "" )
                .Replace( ";", "" );
        }
    }
}
